from typing import List


class Solution:
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        tank = 0
        ngas = len(gas)
        old = [-1, -1]
        for i in range(ngas):
            # print(i,old)
            if gas[i] >= cost[i] and (gas[i] == old[0] and cost[i] == old[1]) == False:
                tank = 0
                j = i

                for k in range(ngas):
                    if tank + gas[j] < cost[j]:
                        break
                    tank = tank + gas[j] - cost[j]
                    # print(j,tank)
                    j = (j + 1) % ngas

                # print("end",j,tank,cost[j])
                if j == i:
                    return i

            old[0] = gas[i]
            old[1] = cost[i]

        return -1


